elo_probabilities = function(R_W, R_B, draw = 0.2) {
  var E_W, loss, win, x;
  E_W = 1 / (1 + 10 ** ((R_B - R_W) / 400));
  win = E_W - draw / 2;
  loss = (1 - E_W) - draw / 2;
  // arr = [loss, draw, win]
  x = _.random(0, 1, true);
  // print x,loss,draw,win
  if (x < loss) {
    return 0;
  }
  if (x < loss + draw) {
    return 1;
  }
  return 2;
};

